import React from "react"

export const determineModalContent = (step: number):JSX.Element => {
    switch (step) {
        case 1: 
        return <Span>Registration Step 1</Span>
        case 2: return <Span>Registration Step 2</Span>
        case 3: return <Span>Registration Step 3</Span>
        case 4: return <Span>Registration Step 4</Span>
        case 5: return <Span>Registration Step 5</Span>
        case 6: return <Span>Registration Step 6</Span>
        default: return <></>
    }
}
